<?php

namespace Peru\Reniec;

/**
 * Class CaptchaCodes
 * @package Peru\Reniec
 */
final class CaptchaCodes
{
    private $codes = [
        ['Q', '', '', '', ''],
        ['W', '', '', '', ''],
        ['E', '', '', '', ''],
        ['R', '', '', '', ''],
        ['T', '', '', '', ''],
        ['Y', '', '', '', ''],
        ['U', '', '', '', ''],
        ['I', '', '', '', ''],
        ['O', '', '', '', ''],
        ['P', '', '', '', ''],
        ['L', '', '', '', ''],
        ['K', '', '', '', ''],
        ['J', '', '', '', ''],
        ['H', '', '', '', ''],
        ['G', '', '', '', ''],
        ['F', '', '', '', ''],
        ['D', '', '', '', ''],
        ['S', '', '', '', ''],
        ['A', '', '', '', ''],
        ['Z', '', '', '', ''],
        ['X', '', '', '', ''],
        ['C', '', '', '', ''],
        ['V', '', '', '', ''],
        ['B', '', '', '', ''],
        ['N', '', '', '', ''],
        ['M', '', '', '', ''],
        ['1', '', '', '', ''],
        ['2', '', '', '', ''],
        ['3', '', '', '', ''],
        ['4', '', '', '', ''],
        ['5', '', '', '', ''],
        ['6', '', '', '', ''],
        ['7', '', '', '', ''],
        ['8', '', '', '', ''],
        ['9', '', '', '', ''],
        ['0', '', '', '', ''],
    ];

    /**
     * Get letter.
     *
     * @param $data
     * @param int $position
     * @return string|null
     */
    public function getLetter($data, $position)
    {
        foreach ($this->codes as $code) {
            if ($code[$position] == $data) {
                return $code[0];
            }
        }

        return null;
    }
}